import React from 'react'
import styled from "styled-components";
import img from "./"


function Testinimial() {
    return (
        <div>
            <TestWraper>
                <h1>HIDING IN PLAIN SIGHT</h1>
                <P>With a small footprint and elegant design, The Mirror blends seamlessly into your home. All you need is two feet of wall space to turn any room into a complete home gym.</P>
                <ButtonWrapper type="button" class="btn btn-dark">HOW IT WORKS</ButtonWrapper>
                <IMG src="public\images\download (1).jpg" alt="testinomials.png">
                </IMG>
            </TestWraper>
        </div>
    )
}

export default Testinimial

const TestWraper = styled.div
`text-align:center;
padding:200px 200px;
float:left;
text-align: justify;
box-sizing: border-box;
`
const ButtonWrapper = styled.button
`background: none;
border-width: 2px;
border-radius: 2px;
border-style: solid;
border-color: #2b2b2b;
color: #2b2b2b;
padding: 1rem 2rem;
min-width: 16rem;
text-transform: uppercase;
transition: all 200ms ease;
text-decoration: none;
letter-spacing: 3px;
font-size: 1rem;
`

const IMG = styled.img

`
float:right;
height:50%;
width:50%;
`

const P = styled.p
`text-align:right;
text-align:justify;
`
